14299	14386	Ashwith Jerome Rego	English	Bangalore, Karnataka, India	{"6002x_exit_response": {"smartphone_usage": ["I would like to use a mobile device to <strong>sometimes</strong> access edX courses.", "I use an Android device."], "teach_ee": ["I do not teach EE."], "rating": ["7 - Absolutely amazing. I learned a great deal."], "ee_level": ["More than one year of EE in college/university"], "future_offerings": ["true"], "gender": ["Male"], "rating_lectures": ["7 - Excellent."], "future_classes": ["true"], "future_updates": ["true"], "favorite_parts": ["It's actually very hard to decide a favourite so I'm going to say what helped me the most.\\r\\n\\r\\nSomething that was very helpful were the assignments and labs. I feel most of my learning happened there. I've read books before this but when I tried applying what I learned to real problems, I wouldn't know how to start. The assignments in 6.002x changed that. The labs where you had to listen to music and hear the effects of a filter were very insightful and a lot of fun. \\r\\n\\r\\nSome of the tutorials were really good. My real issue is: how do I apply what I learn in the real world? Like the assignments, the tutorials also helped address this. Also, from the tutorials I viewed, the team who solved questions from the book picked the harder problems of the textbook instead of simple ones and I think this is good as well. It gives us hints on how to attack such problems. \\r\\n\\r\\nHaving two instructors in some of the tutorials was a unique idea. Prof. Gerry and Piotr's tutorials felt more like an active discussion than a simple instructional video - there were interruptions, arguments, different points of view and some light moments as well. This made learning a lot more fun and gave it a bit of a personal touch. I got to know you better.\\r\\n\\r\\nProf. Agarwal's way of teaching is very unique in two ways: 1. He makes sure that you're always paying attention (and I still don't know how). I've not lost my concentration even once despite this not being in a real classroom. 2. He has a LOT of energy. It inspired me to study the subject even better. He was particularly careful to go over every detail of the difficult parts and the demos were exceptional and very very well designed.\\r\\n\\r\\nThe infrastructure:\\r\\nThe Courseware page's design was very user friendly. The layout was well planned. The option to change a video's speed and click on the captions was very useful in my case. In the discussion forums, the only issue I had is finding topics. I feel that we should have a few categories to sort things out. There were some of us who have never seen this kind of forum structure before (I was one) so getting used to the tags took a while. Also depending on someone using the right tags may not work always. Having a wiki was very useful. The kind of information that has been collected there is amazing.\\r\\n\\r\\nFinally, I liked the interaction between the staff and us - especially the non-formal elements like guessing Prof. Agarwal's dogs name, SHF telling a bit about her background when she gave her views on cheating, the photos of the team which were posted recently, Piotr telling us about how he got an FPGA board for free and how that touched him. I never thought an online course could have a personal element to it. Now I see it can.\\r\\n\\r\\nFinally, I can never say enough of it but thank you! You all are the most passionate and dedicated team I have met so far. This course has been like a big favour for me and it inspired me re-do all of my engineering subjects again as I wasn't very strong in most of them. I will never forget this and I can't wait to see what's next!"]}}	course.xml	NULL	NULL	NULL	NULL	NULL	1	NULL	NULL	NULL	NULL
