104395	105240	Luis Francisco Yanes Melús	spanish	Cádiz, Spain	{"6002x_exit_response": {"rating": ["5"], "teach_ee": ["I do not teach EE."], "improvement_textbook": ["Include the WWW parts in the book and give solution to all exercises and problems. Crowdsourcing the solutions captcha-style will make it painless. Some parts naming people solving the speaker filter problem were weird and childish for a theory course. May work better with dramatized videos though."], "ee_level": ["More than one year of EE in college/university"], "improvement_homework": ["More homeworks! Make available so much homeworks than nobody could complete all of them even if are just exercises like in the lectures. I prefer algebraic expressions input WAY better than so much numerical input. Add a submission counter like in the exams even if it has no limit. Make the input box BIGGER and render input algebraic expressions in a WYSIWYG box to help to avoid annoying and time consuming mistakes. I used algebraic expressions and let the input calculator solve."], "engineering": ["Bachelor's degree"], "why_course": ["The entertainment value of the course"], "rating_tutorials": ["4 - Okay."], "future_updates": ["true"], "rating_homework": ["7 - Excellent."], "rating_labs": ["6"], "university_comparison": ["This course was <strong>on the same level</strong> as the university class."], "rating_lectures": ["6"], "future_classes": ["true"], "favorite_parts": ["Homeworks and labs. The UI is very good still there is room to keep improving it and making it more user friendly an intuitive focusing in the problems and not in the algebraic input. I liked this course A LOT. Was very entertainig and refreshed many knowledge. I'm eager to take similar courses soon!"], "highest_degree": ["Secondary/high school."], "book_count": ["More than 500 books"], "future_offerings": ["true"], "computer_in_home": ["Yes"], "work_offline": ["I worked completely on my own."], "improvement_lectures": ["The handwritting was not very good (sorry dear prof. Agarwal you are awesome anyway :) and there were lots of talk. The pointer was no very visible on low res video. Two paired lecture versions would be nice: a long one with lot of basic explanations and a one short one laying out concepts schematically and conventions."], "improvement_tutorials": ["Make them short and to the point, well indexed by concepts and lots and lots of them. Standarize the format whenever possible and script them to not wander of the subject. May be wikified."], "rating_textbook": ["6"], "smartphone_usage": ["I would like to use a mobile device to <strong>sometimes</strong> access edX courses.", "I do not use an internet-capable mobile device."], "online_course_count": ["1"], "gender": ["Other"], "age": ["35-44"], "improvement_labs": ["Of course, also more labs! And lab exercises in the lecture sequences. More powerful simulator with dependent sources. Real images of the circuits and equipment used along the schematics. Some graphical sequences or video dramatizing some of the possible (explody!) results."], "weekly_hours": ["4"], "parents_engineering": ["No"], "race": ["Western European"], "math_level": ["Vector calculus or differential equations"], "improvement_ideas": ["Adding many of the wiki wish list suggestions. Add some optional hardware project at the end of the course with the basic components studied to make people learn to use componets in real life and solder, etc. Very important. Better forum with hierarchical sections. Now with all mixed is a mess. Something autoupdating posts like twitter, with XHTMLRequest or websockets or similar would be great. May add multiple optional contests or a tournament mode between randomly formed groups where each participant have te option to see the correct solutions of his/her groups and contribute the unsolved ones to reach the final solution faster.\\r\\nProvide download links or official torrent/edonkey packs for lectures. I could have not watched them without downloading because my computer is too slow. Others have poor bandwidth or unstable connections."], "internet_access": ["At home"]}, "old_emails": [["melus0@teleline.es", "2013-04-16T11:36:25.361729"]], "old_names": [["Luis Yanes Mel\\u00fas", "Full name. Thanks!", "2012-06-27T11:38:16.236886"]]}	course.xml	NULL	NULL	NULL	NULL	NULL	1	NULL	NULL	NULL	NULL
